{
var lib = getParameterByName('serve') || "def0";
setTimeout(function(){    document.title="Loading..."}, 1000)
    try {
var home=document.getElementById("homepage").href+"?serve="+lib;
setTimeout(function(){window.location=home}, 5000)
}
catch (err){}
}
function getParameterByName(name, url) {
    if (!url) url = window.location.href;
    name = name.replace(/[\[\]]/g, "\\$&");
    var regex = new RegExp("[?&]" + name + "(=([^&#]*)|&|#|$)"),
        results = regex.exec(url);
    if (!results) return "def0";
    if (!results[2]) return "def0";
    return decodeURIComponent(results[2].replace(/\+/g, " "));
}
